import React, { Component } from 'react';
import { Row, Col, Container, Image, Card, Form, CardGroup } from 'react-bootstrap';
import './Mapa.css';

// import imgAurisLogo from './imgPartneri/auris-logo.png';
// import imgAcAlfaLogo from './imgPartneri/ac-afla-logo.png';
// import imgCofusLogo from './imgPartneri/cofus-logo.png';
export default class Mapa extends Component {
	render() {
		return (
			<React.Fragment>
				<dir className="section-padding-mapa bg-section-mapa">
					<Container>
						<Row>
							<Col lg={12}>
								<Form>
									<Col>
										<Form.Control placeholder="First name" />
									</Col>
								</Form>
							</Col>
						</Row>

						<Row>
							<Col lg={1} />

							<Col lg={9}>
								<Form.Control placeholder="First name" />
							</Col>

							<Col lg={1} />
						</Row>
					</Container>
				</dir>
			</React.Fragment>
		);
	}
}
